/**
 * APISENSE request helper
 */
var request = require('request');
/* API_URL : The destination URL of the HTTP request */
const API_URL = 'https://honeycomb.apisense.io/api/v1/crop/38BjnaBjW0i9AP4w0KRg/data';
/* filename : File generated .js 
   params :  date:min max
   callback : function to call after primary Function()
   */
var query = function(filename, params, callback) {
	request(API_URL
		, callback
	);
};
/* Use in other modules */
module.exports.query = query;
